import { Grid, Typography, Box, TextField } from "@mui/material";
import { Fragment } from "react";


const InfoContent = (props) => {
  const data = props.data;
  const rows = [
    {
      "대표자명": data.represent,
      "사업자 등록번호": data.corporate_number,
      "종목": data.description,
      "담당자명": data.director,
      "담당자 직함": data.position,
      "연락처": data.phone_number,
      "이메일": data.email,
      "사업장 소재지": data.address,
    }
  ]
  return (
    <Box
      sx={{
        color: "#919294",
        fontWeight: 400,
        fontSize: "12px",
        lineHeight: "140%",
        height: "210px"
      }}
      fullwidth
    >
      {/* <Box
        sx={{
          display: "flex",
          mb: "5px",
          ml: "20px",
        }}
      >
        <Box sx={{ width: "150px" }}>업체명</Box>
        <Box
          sx={{
            width: "100%",
            fontWeight: 600,
            color: "#3855B3",
          }}
        >
          주식회사 소더코드
        </Box>
      </Box> */}
      {
        rows.map((value, i) => (
          <Box sx={{ display: "flex", mb: "5px", ml: "20px", }}
          >
            <Box sx={{ width: "150px" }}>대표자명</Box>
            <Box sx={{ width: "100%" }}>오재현</Box>
          </Box>
        ))
      }


    </Box>
  );
};

export default InfoContent;
